import React, { Component } from 'react';

import NewDNA from '../../../Components/NewDNA/NewDNA';
import classes from './ViewDNA.module.css';

class ViewDNA extends Component {
    render(){
        return(
            <div>
                {this.props.DNA.map(dna => {
                    return <DNA name={dna.sequenceName} description={dna.sequenceDescription} sequence={dna.sequenceDNA}/>

                })}
            </div>
        );
    }
}

export default ViewDNA;
